import React from 'react';

function Goals() {
    return (
        <div className="container my-5 curved-container">
            <div className="row">
                <div className="col-lg-6 col-md-6 col-sm-12 text-start">
                    <h5 className="text-danger">Our Goals</h5>
                    <h1>We Aim To</h1>
                    <h5><span className="text-danger">&gt;&nbsp;</span>Expansion Of The Company</h5>
                    <h5><span className="text-danger">&gt;&nbsp;</span>Maintain Client Satisfaction</h5>
                    <h5><span className="text-danger">&gt;&nbsp;</span>Preserving And Developing The Engineering Profession</h5>
                    <h5><span className="text-danger">&gt;&nbsp;</span>Achieving Goals At The Lowest Cost And Safety</h5>
                    <br/><button type="button" className="bg-black text-white w-25 py-2">LEARN MORE</button>
                </div>
                <div className="col-lg-6 col-md-6 col-sm-12">
                    <img src="/goals.webp" className="card-img-top" alt="description" />
                </div>
            </div>
        </div>
    );
}

export default Goals;
